Information
------------------------------

200 Nips &amp; Tucks And I Want More!
This startling film meets those whose pursuit of the ultimate body has taken over their lives.
In California, 58-year-old Monique has been going under the knife for 35 years. Following over 200 plastic surgery procedures at a cost in excess of $200,000, she is now one of the most surgically enhanced people in the world.
In Liverpool, 28-year-old Carolyn Anderson has been dubbed the Scouse Pammy. Her transformation from a brunette to a buxom blonde beach bomb began 14 years ago, when her dad commented that she looked like the 'Baywatch' star.
Gavin, aka Diablo Delenfer, 'The Devil Man', has horns, fangs and a split tongue. He has even had the whites of his eyes tattooed a permanent red, and still to come is the metal Mohawk...
Finally, meet Orit, a high-maintenance Israeli beauty who prides herself on looking like a doll and whose plastic surgeon is on call for her at all hours.



